#include <time.h>

void sortBabelkowe(int *tab,int n){
    for(int i = 0 ;i < n-1; i++){
        for(int j = 0; j < n-i-1; j++){
            if(tab[j+1] < tab[j]){
                int tmp = tab[j+1];
                tab[j+1] = tab[j];
                tab[j] = tmp;
            }
        }
    }
}

void sortUBabelkowe(int *tab,int n){
    int flaga;
    for(int i = 0 ;i < n-1; i++){
        flaga = 0;
        for(int j = 0; j < n-i-1; j++){
            if(tab[j+1] < tab[j]){
                int tmp = tab[j+1];
                tab[j+1] = tab[j];
                tab[j] = tmp;
                flaga = 1;
            }
        }
        if(flaga == 0){
            break;
        }
    }
}

void sortWstawianie(int *tab, int n){
    int klucz;
    int j;
    for(int i = 1;i < n;i++){
        klucz = tab[i];
        j = i-1;
        while(j >= 0 && tab[j]>klucz){
            tab[j+1] = tab[j];
            j--;
        }
        tab[j+1] = klucz;
    }
}

void sortWybieranie(int *tab, int n){
    int min;
    int tmp;
    for(int i = 0; i < n-1; i++){
        min = i;
        for(int j = i+1; j < n; j++){
            if(tab[min] > tab[j]){
                min = j;
            }
        }
        if(min != i){
            tmp = tab[i];
            tab[i] = tab[min];
            tab[min] = tmp;
        }
    }
}

void printArray(int *tab,int n){
    printf("\n");
    for(int i = 0 ; i < n ; i++)
        printf(" %d |",tab[i]);
    printf("\n");
}

int * copyArray(int * tab, int n){
    int *newArray = (int*) malloc(n*sizeof(*tab));
    for(int i = 0; i < n; i++)
        newArray[i] = tab[i];
    return newArray;
}

void foreachElement(int *tab,int n, void (*func)(int*,int),int num){
    for(int i = 0; i < n; i++){
        (*func)(tab+i,num);
    }
}

void printTimeOfSort(int *tab,int n, void (*sortFunction)(int*,int)){
    time_t stime,etime;
    int* tab2 = copyArray(tab,n);
    
    stime = clock();
    (*sortFunction)(tab2, n);
    etime = clock();
    
    printf("\nWykonane w ciÄ…gu: %d s.\n", (etime-stime)/CLOCKS_PER_SEC);
    free(tab2);
}

